import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import React from 'react';
import NavLink from 'react-bootstrap/esm/NavLink';
import {   BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Interaction from '../Page/interaction';
import Page2 from '../Page/page2';





export default class Navtop {
    render() {
  const menudata = [
    {
      path:'/interaction',
      name:"Interaction check"
    },
    {
      path:'/page2',
      name:"Drug suggestion"
    },
    {
      path:'/info',
      name:"Patient information"
    },
  ]


  return (
    <Router>
    <Navbar  className='Topnav' expand="lg">
      <Container>

        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            {
              menudata.map((item) => (
                <NavLink to={item.path} key={item.name} href={item.path}>
                  <div className='list_item'>{item.name}</div>
                </NavLink>

              )) 
            }
          </Nav>
        </Navbar.Collapse>
      </Container>
      <div>
      <Switch>
        <Route path="/page2">
          <Page2 />
        </Route>
        <Route path="/interaction">
          <Interaction />
        </Route>
        <Route path="/">
          <Interaction />
        </Route>
      </Switch>
      </div>
    </Navbar>
    </Router>
  );
}
}
//export default Navtop;
